d_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:2239:"&quot;这是一个灵气为王的世界，谁拥有吞天噬月的灵力，谁就是大主宰！ 大千世界，万道争锋主宰之路，谁主沉浮？ 少年牧尘，资质卓绝，出生于北灵境九大域之一牧域。父亲是牧域之主牧锋，如今已是北灵盟盟主，母亲清衍静是浮屠古族的神女，在其年幼时为保护儿子和丈夫而被迫离开。从此牧尘立下誓言，将来一定要找回母亲。牧尘凭借天赋被审判之镜选中进入竞技历练，在历练时救了陷入困境的少女洛璃，两人产生了懵懂的感情，相约以后一起进入北苍灵院。作为北灵境唯一进入竞技的人，却在一年后因别人算计，被诬陷为“灵路血祸”的元凶而被逐出比赛。 不屈的牧尘在机缘巧合下与万兽录地榜第十一的九幽雀缔造血脉连接，获得神功。通过刻苦训练，牧尘参加学院面向牧域的海选，突破至尊境界并取得冠军，得以进入北苍灵院学习。适逢五大院种子名额争夺战开启，牧尘一举夺冠成为北灵境内第一位获得五大院种子名额的学员。 为了救母亲，牧尘要变得更强，他与九幽雀为了寻找能锤炼能力、提升自我的“不朽图纸”，闯入精彩绝伦的大千世界，来到疆域辽阔的大罗领域。之后他得到天帝传承，在圣龙大陆铲除血魔族，得到了位面之灵的相助，将能力突破到天至尊，在经历腥风血雨后，解救母亲，成为浮屠古族的族长。在万古会中，牧尘成功获得万古不朽身，跻身大千世界颠峰层次的存在之一，为了拯救大千世界的生灵，牧尘闭关五年后，突破出关超脱圣品，与炎帝”萧炎、武祖“林动”合力对战天邪神。借助大千世界亿亿生灵之力的战意，他们消灭了为祸人间的邪族，并以世界之力净化被域外邪族夺走的另一半的大千世界。当一切尘埃落定，牧尘与洛璃在父母、林动、萧炎等人的见证下，举行大婚，并有了女儿牧云熙。最终，牧尘成功在苍穹榜上留下完整真名，并将其命名为&quot;&quot;主宰境&quot;&quot;，与萧炎、林动一起成为大千世界的守护者。&quot;";s:13:"vod_play_from";s:30:"subom3u8$$$zuidam3u8$$$172m3u8";s:15:"vod_play_server";s:12:"no$$$no$$$no";s:13:"vod_play_note";s:6:"$$$$$$";s:12:"vod_play_url";s:5372:"第01集$https://www.48iuz.com/20190105/h0tGpMnp/index.m3u8#第02集$https://www.48iuz.com/20190105/7KPda99v/index.m3u8#第03集$https://www.48iuz.com/20190105/BSBj6Ut8/index.m3u8#第04集$https://www.48iuz.com/20190105/bckL5lZ8/index.m3u8#第05集$https://www.hongxinhuaxue.com/20190109/DfqbLRPN/index.m3u8#第06集$https://www.hongxinhuaxue.com/20190116/Y0WNZt4k/index.m3u8#第07集$https://www.48iuz.com/20190123/ZgqnqkkL/index.m3u8#第08集$https://www.48iuz.com/20190130/NtzIMwPH/index.m3u8#第09集$https://www.48iuz.com/20190206/2Z1znFqj/index.m3u8#第10集$https://www.hongxinhuaxue.com/20190213/IQjjszoa/index.m3u8#第11集$https://www.48iuz.com/20190220/MVCgDlUU/index.m3u8#第12集$https://www.48iuz.com/20190227/MtKWBb6w/index.m3u8#第13集$https://www.48iuz.com/20190306/7hSzs1s6/index.m3u8#第14集$https://www.dt870.com/20190313/iViRFYPp/index.m3u8#第15集$https://www.183757.com/20190712/sBRhC1uS/index.m3u8#第16集$https://www.183757.com/20190712/F81p7Kjz/index.m3u8#第17集$https://www.183757.com/201